import { Provider } from "react-redux";
import { Store } from "./store/store";
import UserForm from "./User_Form";
import User from "./User";

export default function App(){


    return(

        <>
        <Provider store={Store}>
            <User/>
            <UserForm/>
        </Provider>
        </>
    )
}
